import React from "react";
import { Row, Col, Input, Divider, Button, Typography } from "antd";
const Cabinet = ({}) => {
  return (
    <Fragment>
      <Input
        value={first_name}
        name="first_name"
        onChange={this.handleChange}
      />
      <select value={gender} name="gender" onChange={this.handleChange}>
        <option value="Male">Male</option>
        <option value="Female">Female</option>
      </select>
      <Input
        value={last_name}
        name="last_name"
        onChange={this.handleChange}
        max={10}
      />
      <Input value={age} name="age" onChange={this.handleChange} />
      <Input value={address} name="address" onChange={this.handleChange} />
      <Input value={email} name="email" onChange={this.handleChange} />
      <select
        name="work_position"
        value={work_position}
        onChange={this.handleChange}
      >
        <option value="Chef">Chef</option>
        <option value="Manager">Manager</option>
        <option value="Waiter">Waiter</option>
        <option value="Cleaner">Cleaner</option>
      </select>
      <Input
        value={phone_number}
        name="phone_number"
        onChange={this.handleChange}
      />
      <Input value={password} name="password" onChange={this.handleChange} />
      <Button onClick={this.handleUpdate}>Edit</Button>
    </Fragment>
  );
};

export default Cabinet;
